import axios from 'axios';
import React, { useEffect, useState } from 'react';

function UserOrders() {
    const [orders, setOrders] = useState([]);

    const getUserOrders = () => {
        const token = localStorage.getItem('userToken');
        axios
            .get('http://localhost:5000/orders/user', {
                headers: { Authorization: token }
            })
            .then((response) => setOrders(response.data))
            .catch((err) => console.error(err));
    };

    useEffect(() => {
        getUserOrders();
    }, []);

    return (
        <div className="container-fluid p-4">
            <h2 className="text-center mb-4">Your Orders</h2>
            {orders.length === 0 ? (
                <h4 className="text-center text-muted">No orders placed yet.</h4>
            ) : (
                orders.map((order, index) => (
                    <div key={order._id} className="card mb-4 shadow-sm">
                        <div className="card-body">
                            <h5 className="card-title mb-2">Order #{index + 1}</h5>
                            <p><strong>Status:</strong> {order.status}</p>
                            <p><strong>Payment Mode:</strong> {order.paymentMode || 'N/A'}</p>
                            <p><strong>Order Date:</strong> {new Date(order.orderDate).toLocaleString()}</p>
                            <hr />
                            <h6>Items Ordered:</h6>
                            <ul className="list-group mb-3">
                                {order.items.map((item, idx) => (
                                    <li key={idx} className="list-group-item d-flex justify-content-between align-items-center">
                                        <div>
                                            <strong>{item.name}</strong> (x{item.quantity})
                                        </div>
                                        <div>₹ {(item.price * item.quantity).toFixed(2)}</div>
                                    </li>
                                ))}
                            </ul>
                            <div className="mb-2"><strong>Total Amount:</strong> ₹{order.totalAmount.toFixed(2)}</div>
                            <div className="mb-2"><strong>GST (18%):</strong> ₹{order.gst.toFixed(2)}</div>
                            <div className="mb-2"><strong>Total Bill:</strong> ₹{order.totalBill.toFixed(2)}</div>
                            {order.recipient && (
                                <>
                                    <hr />
                                    <h6>Shipping Information:</h6>
                                    <p><strong>Recipient:</strong> {order.recipient}</p>
                                    <p><strong>Email:</strong> {order.email}</p>
                                    <p><strong>Phone:</strong> {order.phone}</p>
                                    <p><strong>Address:</strong> {order.shippingAddress}, {order.pincode}</p>
                                </>
                            )}
                        </div>
                    </div>
                ))
            )}
        </div>
    );
}

export default UserOrders;
